detaileddescription.para:
This powerful macro allows you to visit the set of elements designated by any type of collection. The first argument <Type> defines the type of elements that will be visited and the third argument <collection> is the traced collection. The code body located between macros for_each and end_for (that must not be forgotten) is then executed for each identified element, once this current element has been bound to the variable (you can exit prematurely with a traditional break). Sample use : Cell*cell=...;//wegetthecell

if(cell){
forEach(Net*,inet,cellgetExternalNets()){
assert(inet->isExternal());
assert(inet->getCell()==cell);
}
}
 On this example the call to cell->getExternalNets() returns the collection of all external nets of the cell. Here the loop does some consistency checks on each net. As we will see later on there exist macros for each type of object which might be an element of a collection. Therefore the following sequence is equivalent to the previous one: Cell*cell=...;//wegetthecell

if(cell){
forEach(Net*,inet,cellgetExternalNets()){
assert(inet->isExternal());
assert(inet->getCell()==cell);
}
}

Macro for visiting all properties of a property collection. Occurrenceoccurence=...;//wegetanoccurence

forEach(Property*,iproperty,occurence.getProperties()){
cerr<<*iproperty<<endl;
}
